message:
Байден выступил с очередным заявлением на саммите G7 касательно новых санкций против РФ — президент США готов ввести санкции лично против Путина и ограничить Россию от половины высокотехнологичного импорта

— страны «большой семерки» отрежут РФ от половины высокотехнологического импорта — это не позволит модернизировать вооруженные силы и реализовать аэрокосмическую программу России;

— G7 предоставит Украине военную помощь на 650 млн долларов, но войска НАТО в конфликте участвовать не станут;

— российский бизнес не сможет проводить операции в в долларах и евро, фунтах и йенах, «коррумпированные миллиардеры» будут преследоваться;

— дополнительные войска НАТО будут переброшены в Германию, Прибалтику, Польшу и Литву;

— также Байден обратился к нефтяным компаниям с просьбой «не пользоваться моментом и не повышать цены на нефть». При необходимости, США готовы вывести нефть из резервов — это снизит цены на топливо.

От SWIFT Россию отключать все еще не планируют. Активы ВТБ в США будут заморожены.

«Сейчас войск России в ДНР нет, но в будущем их нахождение здесь возможно» — Пушилин проводит пресс-конференцию в Донецке

Глава ДНР сообщил, что хочет мирно решить вопрос возвращения под контроль территорий Донецкой и Луганской областей, подконтрольных сейчас Украине, а также подчеркнул, что в ДНР возможны теракты, так как Киев настроен агрессивно. 

Что еще сказал Пушилин:

— войска России имеют право находиться в ДНР согласно договору о союзничестве;

— после признания Республик количество обстрелов и провокаций со стороны ВСУ увеличилось;

— «формально мы больше не Украина, будем работать для упрощения пересечения нашими гражданами границы с РФ».

Основные тезисы выступления Джо Байдена:

– США не собираются воевать с Россией, но будут защищать каждый дюйм территории НАТО;

– РФ начала вторжение на территорию Украины;

– Санкции против России коснутся суверенного долга РФ, российских элит и двух банков;

– США продолжат оказывать помощь Украине в сфере обороны;

– США продолжат работать вместе с Германией, чтобы не допустить запуск "Северного потока-2";

– Санкции будут ужесточаться в зависимости от поведения России на Украине;

– Если Россия не выведет свои войска из Беларуси, НАТО укрепит воинский контингент в Литве, Латвии и Эстонии.

После завершения конференции Байден покинул зал, не ответив ни на один вопрос журналистов.
